$('#pilihtanggal .choosedate').datepicker({
    'format':'d M yyyy',
    'autoclose':true,
});
/* end datepicker */



/* flex thumbnail */
var flex_thumb = function(){
	$(".flex_thumb").each(function(){
		$(this).find("img").css("opacity",0);
		var $source = $(this).find("img").attr("src");
		$(this).css({
		  'backgroundImage':'url(' + $source +')'
		});
	});
}
/* end flex thumbnail */



/* tabception */
jQuery('.tabception ul.tabs').each(function(){
    var $active, $content, $links = jQuery(this).find('a');
    $active = jQuery($links.filter('[href="'+location.hash+'"]')[0] || $links[0]);
    $active.addClass('active');
    $content = $($active[0].hash);

    $links.not($active).each(function () {
        jQuery(this.hash).hide();
    });

    jQuery(this).on('click', 'a', function(e){
        $active.removeClass('active');
        $content.hide();

        $active = jQuery(this);
        $content = jQuery(this.hash);

        $active.addClass('active');
        $content.show();
        e.preventDefault();
    });
});
/* tabception */



/* function afterload refresh */
var refresh_up = function(){
  var scroll = $(window).scrollTop();
  $("html").scrollTop(scroll);
  $('body').delay(1).animate({
    'scrollTop': $(window).scrollTop()-1
  },100);
}
/* end function afterload refresh */



/* sticky header */
var sticky_header = function(){
  $(window).resize(function(e){
    console.log(e);                   
  });

  /* header desktop */
  $(window).scroll(function (event) {
    var sc = $(window).scrollTop();
	var hh = 100;
	
	if(sc >= hh){
	  $("header").addClass("header-fixed");
	  $(".dummy-header").css("display","block");
	}
	else{
	  $("header").removeClass("header-fixed");
	  $(".dummy-header").css("display","none");	
	}
  });
}
/* end sticky header */



/* mobile hamburger button */
var mobile_menu_open = function(){
  $(".top-hamburger > a").click(function(){
    $(".mobile-menu").fadeToggle(100);
	$(this).parent().toggleClass('open');
	$("body").toggleClass('noscroll');
  });
}
/* end mobile hamburger button */



/* mobile menu dropdown button */
var mobile_submenu_open = function(){
  $(".mobile-open-submenu").click(function(){
    $(this).parent().toggleClass("curr");
	$(this).parent().find(".submenu").toggle();
	$(".mobile-open-submenu").not(this).parent().removeClass("curr");
	$(".mobile-open-submenu").not(this).parent().find(".submenu").hide();
  });
}
/* end mobile menu dropdown button */



/* open compare doctor */
var mobile_menu_open = function(){
  $(".dcp-title > div > a").click(function(){
    $(".dcp-detail").fadeToggle(200);
  });
}
/* end open compare doctor */



/* rs slideshow */
$('.rs-slide .rs-preview').slick({
  lazyLoad: 'ondemand',
  slidesToShow: 1,
  slidesToScroll: 1,
  arrows: true,
  fade: true,
  asNavFor: '.rs-nav'
});
$('.rs-slide .rs-nav').slick({
  lazyLoad: 'ondemand',
  slidesToShow: 2,
  slidesToScroll: 1,
  asNavFor: '.rs-preview',
  arrows: false,
  dots: false,
  centerMode: true,
  focusOnSelect: true,
  responsive:[{
	breakpoint:1025,
	settings:{
	  slidesToShow:4,
	}
  },
  {
	breakpoint:769,
	settings:{
	  slidesToShow:3,
	}
  },
  {
	breakpoint:415,
	settings:{
	  slidesToShow:2,
	}
  },
  {
	breakpoint:376,
	settings:{
	  slidesToShow:1,
	}
  }]
});
/* end rs slideshow */



$(document).ready(function(){
  flex_thumb();
  refresh_up();
  sticky_header();
  mobile_menu_open();
  mobile_submenu_open();
});